als across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Introduïu un % de lliscament vàlid","Powered by the Uniswap protocol":"Impulsat pel protocol Uniswap","Price impact":"Impacte en el preu","Price updated":"Preu actualitzat","Reload":"Reload","Reload the page":"Torna a carregar la pàgina","Request rejected":"Request rejected","Review swap":"Intercanvi de ressenyes","Search by token name or address":"Cerca per nom o adreça de testimoni","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Alguna cosa ha anat malament","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Èxit","Swap":"Intercanvi","Swap failed: {0}":["Ha fallat l'intercanvi: ",["0"]],"Switch network":"Canvia de xarxa","Switch network in your wallet":"Canvia de xarxa a la teva cartera","Switching network":"Xarxa de commutació","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"L'invariant Uniswap x * y = k no va quedar satisfet per l'intercanvi. Normalment, això significa que un de les fitxes que canvieu incorpora un comportament personalitzat en la transferència.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and out