iscament. Nota: els tokens de transferència i rebase no són compatibles amb Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Aquesta transacció no tindrà èxit a causa del moviment de preus o de la comissió de transferència. Proveu d'augmentar la tolerància al lliscament.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Termini de transacció","Transaction rejected":"Transacció rebutjada","Transaction submitted":"Transacció enviada","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Intenteu augmentar la vostra tolerància al lliscament.<0/>NOTA: La tarifa de les fitxes de transferència i rebase no és compatible amb Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Error inesperat. No s'ha pogut estimar el gas per a l'intercanvi.","Unexpected issue with estimating the gas. Please try again.":"Problema inesperat en estimar el gas. Siusplau torna-ho a provar.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Veure a Etherscan","Wallet disconnected":"Wallet disconnected","Warning":"Avís","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"La transacció es revertirà si ha estat pendent durant més d'aquest període de temps.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"La vostra transacció es revertirà si el preu canvia desfavorablement en més 